import React,{Component} from 'react';

class ErrorBoundary extends  Component{
    
    constructor(props){
        super(props)
        this.state={
            hasError:false
        }
    }

    static getDerivedStateFromEror(error){
        return{
            hasError:true
        }
    }
    render(){
        return(
            <div>
                <h1>error handling</h1>
            </div>
        )
    }
}

export default ErrorBoundary;
